import React from "react";
import ReactDOM from "react-dom";
import "./index.css";

var reptiles = ['alligator', 'snake', 'lizard'];

class ItemList extends React.Component {
    constructor(props) {
      super(props);
      this.state = {value: ''};
      this.addItem = this.addItem.bind(this);
      }

    render(){
        return (
            <div className="todoListMain">
        <div className="header">
          <form onSubmit={this.addItem}>
            <input placeholder="enter task">
            </input>
            <button type="submit">add</button>
          </form>
        </div>
      </div>
        ); 
    }
}



// Do stuff
class DoStuff extends React.Component {
    constructor(props) {
      super(props);
      this.state = {
        items: []
      };
    }
    render(){
        return (
            <ItemList entries={this.state.items} delete={this.deleteItem}/>
        );
    }
}



// Makes the form appear in the modal, always
class Form extends React.Component {
    constructor(props) {
      super(props);
    }
    render(){
        return (
            <form id="form" onsubmit={this.addItem}>
          <input type="text" name="input" id="input" placeholder="Item"/>
          <input type="date" name="expiry" id="expiry"/>
          <input type="submit" class="btn btn-default" data-dismiss="modal"/>
        </form>
        );
    }
}



// ReactDOM Renders

ReactDOM.render(
    <div>
        <DoStuff />
    </div>,
    document.getElementById("list")
); 

ReactDOM.render(
    <div>
        <Form />
    </div>,
    document.getElementById("form-root")
);
